{"services_in_this_area": null, "ber_detail": ["BER: F", "BER No.106924996", "Energy Performance Indicator: 387.69 kWh/m/yr"], "features": ["Underfloor Heating", "Unique Property", "Close to all amenities and transport links.", "Furnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Microwave", "Cable TV", "Internet", "Alarm", "Suits Professionals", "References Required", "Walk-in Shower"], "agentFax": null, "negotiator": "Negotiator: Clare Connolly", "agentName": "Clare Connolly Property Consultants", "property_type": "2 Bed Detached To Let  9 months lease", "leaseTerm": "9 months Lease", "latitude": 53.3330736, "description": "SIX-TWELVE MONTH LET - This original Georgian coach house converted by Architect Ross Cahill O'Brien in to a truly stunning home combining old with new is available for short-term letting. It featured in Image Magazine and in US publication 'Decor' which describes the front drawing room as 'One of the Most Inspiring Rooms Ever'. The owner, a Los Angeles based interior decorator has sourced the antique pieces found in the coach house mainly from Italy and France. Such elegant pieces have turned a successful architectural project into a wonderful home with a spacious, calm feel. The breath taking main living room is light-filled stretching upwards to the 20 foot high ceiling. The Bulthaup kitchen is open to the main room if a client wishes to entertain in a casual atmosphere. A wide, low pivoting door opens over an external pond, the centrepiece of the garden. The garden is enclosed by the same limestone walls as the house, with similar proportions to the original coach house. The elegant staircase leads with white stone steps on to slated timber ones supported on a light weight steel arch. Upstairs, a steel walkway has slatted beech flooring, the balcony providing a bright, library area with views to the main room below and access to the main bedroom suite. The master bedroom has a walk-in wardrobe. The bathroom 