y touches the coast, there is a rich diversity of wildlife to be found in the area with many rare and unusual plants.,The property is located 1.9K from Ballydehob on the Schull road. It is in a private location but is not remote. All services including Electricity, telephone and broadband are in the house. ,There is a Daily West Cork Rural Transport Scheme Serving Communities in West Cork and this Community rural bus service has a door to door service at very reasonable rates and it is even free of charge to senior citizens, you just give them a ring and let them know that you are going to town today.", "price": "300 / week", "image_urls": ["http://photos-a.propertyimages.ie/media/4/4/4/2732444/aW1hZ2Uvd1Z5WFVXdkE1Tzh3YXI3SEc0Q1RsX282Yy1IRWRTdFFBWTZyZDNCNnJCTnNQVGd3TUE9PS5qcGd8NjA5fHx8fHx8aHR0cDovL3d3dy5kYWZ0LmllL2kvd2F0ZXJtYXJrLnBuZz92PTF8fHw%3D%5B1%5D_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": null, "address": "Cooragurteen, Ballydehob, Cork", "shortLink": "www.myhome.ie/2732444", "url": "http://www.myhome.ie/rentals/brochure/cooragurteen-ballydehob-cork/2732444", "longitude": -9.47062683262629, "beds": 4, "agentPhone": "085 7399250", "deposit": 450.0, "ber": null, "agentAddress": "Cappaghglass, Ballydehob, West Cork", "addedOnDate": "Added 1 year ago, refreshed 2 months ago"}
