oubles. ,Each room is carpeted, has black out blinds and custom made interlined curtains. ,The family bathroom is a very pleasant space, with Bath, seperate shower, WC and WHB.", "price": "3250 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/9/1/4/3377419/74045410-100a-40d3-bee8-da5540c33642_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/0182fd29-961e-4f96-b7c2-7cb4406f81e4_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/633b3c32-89b8-4732-9c3a-e9ccdf31e17c_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/f46fc970-62a8-4109-a382-565048b780a1_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/fce71d3d-dccd-470c-aba5-6916f638cf05_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/ea4e53c1-2fd6-45e4-8b45-32537ad469d5_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/5d77827c-c7bc-4a80-9d86-64576ac36eb5_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/639c3697-1dd8-4592-843f-f711f1ae8a44_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/4e3cc755-9280-4b3b-8b15-636a831181ed_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/ee9e8b57-620f-4455-9214-7d69b71797b9_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/09546055-5f88-47ed-9a29-537f64492f0c_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/06b399a1-67dc-400e-bbd6-878a6940e2a7_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/8c137f1c-a588-4212-b6dd-5cfd63d14e5e_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/116be5d9-d6ab-42c1-aed6-ccec7c9ead70_l.jpg", "http://photos-a.propertyimages.ie/media/9/1/4/3377419/13982d31-16d9-4d49-9e8d-bd422f16150f_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": "002052", "address": "Avondale Court, Blackrock, County Dublin", "shortLink": "www.myhome.ie/3377419", "url": "http://www.myhome.ie/rentals/brochure/avondale-court-blackrock-county-dublin/3377419", "longitude": -6.3955002000