{"services_in_this_area": null, "ber_detail": null, "features": ["C 2150 sq ft", "Elevated site with views of Lambay Island", "Detached home", "Excellent condition", "Oil fired central heating", "Double glazed windows", "Family bathroom", "Guest wc/whb/walk-in shower", "Extensive well finished decked area", "3 reception rooms", "5 bedrooms", "Ample off street parking", "Superb location near Howth village", "Unfurnished", "Parking", "Central Heating", "Suits Professionals", "References Required"], "agentFax": "01 854 0026", "negotiator": "Negotiator: Conor Gallagher", "agentName": "Gallagher Quigley", "property_type": "5 Bed Detached 2150 ft / 199.74 m To Let  1 year lease", "leaseTerm": "1 year Lease", "latitude": 53.3736322, "description": "San Jose is an attractive detached property perched upon an elevated site of approximately   acre of private landscaped gardens. Ideally located above the picturesque village of Howth, this endearing home enjoys convenient access to all of the wonderful amenities the amazing Howth peninsula has to offer.,This home has been transformed from its once modest origins into a bright well-appointed family residence with all modern conveniences now in place.,Viewers will be greeted by the extensive cobble locked driveway with off street parking available for several vehicles. A few steps lead from here up to an elevated front deck which is occasionally used for evening barbeques and is an ideal area from which to take in the surrounding vista of Howth hill towards the west and views of Lambay island towards the north.,At approximately c200 sq m or (c2150 sq ft) this home is spacious and comfortable.The enclosed entrance porch leads to the reception hall which is tastefully tiled and is lit by several downlighters. The staircase features a stainless steel hand rail and glass panels and there is ample under stairs storage.,Off the hall is the main living room which is generously proportioned and finished with varnished floor boards and a wood burning stove. This area is open plan into the bright conservatory style dining room due to the rational timber windows and sliding patio door which leads to the rear garden.,The extended kitchen cum breakfast room can be accessed off the dining room or the hall and this area represents one of the finest features of this home. It has extensive timber kitchen cabinets, an island unit and it is finished with granite worktops and a tiled floor. Integrated appliances are included and the 120cm Smeg Range cooker will impress any home chef ! Underfloor heating in the kitchen ensures maximum comfort here and the extra high ceiling has three large velux roof windows to ensure this area enjoys an abundance of natural light throughout the day. Sliding timber doors lead out to the sheltered patio which is paved with colourful Donegal quartz slabs and natural stone walls which border the planted flower beds.,A second family room is located off the hall and it features a polished cast iron fireplace with a cast iron wood burning stove. There is a third sitting room between the hall and kitchen which offers an equally cosy space. There are 5 bedrooms in all and a family bathroom with a sunken Jacuzzi bath. Three of the bedrooms have fitted wardrobes and drawer units. One of the bedrooms is currently used as a home office and has an extensive range of smartly fitted cabinets , work station desks and shelving for this purpose.,The rear garden is another fine feature of this home. The purpose built Griffin green house is of a very high standard  and can accommodate exotic plants that require specially controlled temperatures. The elevated flower beds are well stocked with a colourful variety of plants, trees and shrubs and the elevated rear deck with its barbeque house is a marvellous sheltered sun trap suitable for outside entertaining.", "price": "3300 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/3/4/3/3382343/451c22c3-4044-4832-9a1c-c7aff951c7f8_l.jpg", 