 separate dressing room and ensuite shower room.   Accessed from  the first floor landing away from the master bedroom are four further double bedrooms with one ensuite shower room and a family bathroom with shower cubicle.    Pebblebrook  is located within 5 minutes walking distance to the prestigious schools of  St Gerards Co- Educational Primary and  Secondary  Schools as well as Aravon International Pre  School on the adjacent Ferndale Road.  The house is  located within  short driving distance to transport links  to the city centre , that is  the Luas , the DART, as well as  the M50  and N11.,The Festina Lente Riding School  is adjacent  and Enniskerry Village and the attractions of Powerscourt House and  Gardens are a mere 10 minutes drive  from Pebblebrook.,This substantial family home would be ideal for a Corporate Let   Viewing is highly recommended.", "price": "4000 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/9/9/7/3341799/776c2579-0372-46ae-a463-07a7f65156fd_l.jpg", "http://photos-a.propertyimages.ie/media/9/9/7/3341799/4bfd2097-e2ca-437b-a11c-9843cb920215_l.jpg", "http://photos-a.propertyimages.ie/media/9/9/7/3341799/2ae856fc-cf46-48a3-9627-d543abada23c_l.jpg", "http://photos-a.propertyimages.ie/media/9/9/7/3341799/20a8124e-e28f-4579-aac2-59a98098f9ed_l.jpg", "http://photos-a.propertyimages.ie/media/9/9/7/3341799/d3e89803-a8dc-4154-b4d9-bd93b1842f78_l.jpg", "http://photos-a.propertyimages.ie/media/9/9/7/3341799/9db2ddfa-984f-4116-897e-def30622bc5c_l.jpg", "http://photos-a.propertyimages.ie/media/9/9/7/3341799/5bbfa468-ffdd-4a74-a19e-32f089f5a0eb_l.jpg", "http://photos-a.propertyimages.ie/media/9/9/7/3341799/5d2289a7-f956-4fc2-9080-350522ec1b4f_l.jpg", "http://photos-a.propertyimages.ie/media/9/9/7/3341799/23354889-7aca-4a4b-92e5-d664859410c9_l.jpg", "http://photos-a.propertyimages.ie/media/9/9/7/3341799/4a8b2c75-f0ca-471f-bb65-fc94a3a4a907_l.jpg", "http://photos-a.propertyimages.ie/media/9/9/7/3341799/dfd4326b-25b4-4814-94f2-25a0468