{"services_in_this_area": null, "ber_detail": ["BER:", "BER No. XXX", "Energy Performance Indicator: XXX kWh/m/yr"], "features": ["Furnished", "Parking", "Central Heating", "Washing Machine", "Dryer", "Dishwasher", "Microwave", "Cable TV", "Internet", "Alarm", "Suits Professionals", "References Required"], "agentFax": "01 668 5911", "negotiator": null, "agentName": "Dial A Short Let", "property_type": "4 Bed House To Let  4 months lease", "leaseTerm": "4 months Lease", "latitude": 53.3350248, "description": "Built in 1910, the house is located 5 minutes from Sandymount village and 5 minutes from Sandymount beach. The picturesque village has a lovely park, shops, restaurants, coffee shops, pubs and churches. Sandymount has its own DART (electric train system) with trains every 15 minutes which take you into the city centre in 7 minutes. Once there all cultural, tourist and shopping amenities are readily accessible. The house, which sleeps 6/7, has just been refurbished and extended and is extremely spacious and well laid out. There are two linked reception rooms with direct access to the garden and also to a south facing conservatory. The contemporary designer kitchen has everything that you could need and opens into a beautiful light filled dining space with lovely views of the garden. This space is now linked through a light filled walkway to a new garden room, home office and guest bedroom suite. The guest suite has been designed for multiuses ( yoga, quiet reading, parties) and has a walled king size bed and ensuite bathroom. It also has a small annex room which can be used for a small child. Upstairs three of the original four bedrooms have been converted to a master bedroom suite with a walk in dressing room and ensuite bathroom. The fourth bedroom is used as an upstairs sitting room and has an extremely comfortable sofa bed. There is also a third bathroom adjacent. There is a wonderful, private back garden recently relandscaped and the front driveway has off s