{"services_in_this_area": null, "ber_detail": ["BER:", "BER No. XXX", "Energy Performance Indicator: XXX kWh/m/yr"], "features": ["Double glazed PVC windows,", "Alarm,", "OFCH,", "Private Water,", "ESB & Telephone", "Parking", "Central Heating", "Suits Professionals", "References Required"], "agentFax": null, "negotiator": null, "agentName": "Goffs Country", "property_type": "4 Bed Detached To Let", "leaseTerm": null, "latitude": 53.4097226, "description": "Ballyvoneen House sits on a wonderful mature setting. It benefits from a lovely countryside location, however is easily accessed and only 9km to the M4 & 49km Dublin Airport. The house is approached through a set of old cast iron gates and there are some fabulous copper beech and beech trees to be seen bounding the front garden. In addition there is a large apple orchard just past the garden., The house is entered via a front porch with double doors leading to both the inner hall and sitting room off it. On the ground floor there are 3 reception rooms, study & games room. Whilst on the 1st floor there are 5 bedrooms and a bathroom on the half landing. There is an enclosed yard to the rear of the house with a pump house, tool shed, 2 outhouses with overhead loft and garage.,Location:,It is positioned within an excellent band of agricultural holdings and has the towns of Johnstownbridge, Enfield & Kilcock all within close range along with the university town of Maynooth only 20 minutes drive away. Enfield 3.5km, Maynooth 18km, Dublin City 45km, Dublin Airport 50km.,Amenities:,The house is situated within the bloodstock capital of Ireland with three racecourses to boast including the home of the Irish classics in The Curragh along with the venue of the Irish National Hunt festival in Punchestown. Naas racecourse is also very convenient and an excellent suburban track. There is an abundance of golf courses nearby with Moyvalley, Kilcock, Knockanally and the championship courses of Carton and the K club all very accessible. Fishing is provided by the River Liffey while hunting can be found with either the Kildares, the South Countys or the Westmeaths. The shopping towns of Maynooth and Leixlip are just off the M4 whilst Liffey Valley is accessed of the M50.,Services:,Double glazed PVC windows,,Alarm, ,OFCH,,Private Water, ,ESB & Telephone,Viewing strictly by appointment with the selling agents.", "price": "2500 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/1/5/8/3337851/16e5ccf5-43a7-4af7-adfe-e8997c383cb0_l.jpg"], "viewing": null, "landlordPhone": null, "agentLicence": "001833", "address": "Ballyvoneen House, Cloncurry, Co.Kildare, Enfield, Kildare", "shortLink": "www.myhome.ie/3337851", "url": "http://www.myhome.ie/rentals/brochure/ballyvoneen-house-cloncurry-co-kildare-enfield-kildare/3337851", "longitude": -6.7879762, "beds": 4, "agentPhone": null, "deposit": 3750.0, "ber": "Exempt", "agentAddress": "Kildare Paddocks, Kill, Co.Kildare", "addedOnDate": "Added 1 month ago, refreshed 1 month ago"}
