en.,Landing,With accommodation and hotpress off. Stira leading to floored attic with rear facing Velux and ample under eaves storage areas.,Bedroom 1 - 3.6m X 3.2m,Front facing double bedroom with an abundance of fitted wardrobes.,Bedroom 2 - 3.18m X 2.7m,Rear facing bedroom with Sliderobe fitted wardrobes.,Bedroom 3 - 2.67m X 2.4m,Front facing bedroom.,Bedroom 4 - 2.75m X 2.46m,Rear facing bedroom.,Bathroom - 2.2m X 1.6m,Upgraded bathroom comprising a bath with Triton shower over, wc & whb. Fully tiled. Chrome radiator. Recessed lighting.,Outside:,Front garden with cobble lock type driveway and lawns with plants and shrubs. Gated side entrance leads to the walled-in rear garden which gets the sun from late morning until sunset, faces south west and comprises a decked area with raised lawns, plants and shrubs along with a Barna shed.", "price": "2400 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/3/9/8/3397893/dbc5b529-2a9a-40fa-ba58-d52f549e0028_l.jpg", "http://photos-a.propertyimages.ie/media/3/9/8/3397893/56b78732-5c8e-4724-bbeb-aac44112b3b0_l.jpg", "http://photos-a.propertyimages.ie/media/3/9/8/3397893/e6d2d5ba-b6db-4380-97c4-1108e9704366_l.jpg", "http://photos-a.propertyimages.ie/media/3/9/8/3397893/b7a17b87-a464-4d94-8bf3-5044b78e32b2_l.jpg", "http://photos-a.propertyimages.ie/media/3/9/8/3397893/b7a19187-10b8-4069-b9eb-7798d9bad429_l.jpg", "http://photos-a.propertyimages.ie/media/3/9/8/3397893/d130c57a-6e8c-4857-aa4f-00f944be24d8_l.jpg", "http://photos-a.propertyimages.ie/media/3/9/8/3397893/ceda75aa-b853-4269-a8b5-30720b6e8c33_l.jpg", "http://photos-a.propertyimages.ie/media/3/9/8/3397893/af88dc18-c67e-4da6-a273-db180d8e2e46_l.jpg", "http://photos-a.propertyimages.ie/media/3/9/8/3397893/52cb1e54-12df-4901-bafa-df94465a640d_l.jpg", "http://photos-a.propertyimages.ie/media/3/9/8/3397893/2ea4bc21-5acc-42ec-a992-2a974b70e10d_l.jpg", "http://photos-a.propertyimages.ie/media/3/9/8/3397893/e9dfc34e-669f-4bc2-a73b-384aeb94a442_l.jpg", "http://phot