{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": "01 4966355", "negotiator": null, "agentName": "Galvin Property & Finance", "property_type": "4 Bed SemiDetached To Let  1 year lease", "leaseTerm": "1 year Lease", "latitude": 53.2966812, "description": "House to Rent - 4 Beds - 3 Baths,Galvin Property are delighted to present this superb 4 bedroom semi detached house with study and conservatory. This family residence is in walk-in condition with a brand new kitchen, new bathroom suites, new carpets, and completely repainted throughout. Fosterbrook is an ever popular residential neighbourhood of Tudor Style family homes. Bright spacious accommodation extending to c.141sq.m. / c.1,520sq.ft. includes Living room, Dining room, Study, Kitchen, Utility, 4 bedrooms and 3 luxury bathrooms. No. 34 Fosterbrook has been maintained and tastefully presented in neutral colours and is available to rent furnished or unfurnished in exceptional order. Upon entering this impressive home, you are greeted by an entrance porch, which leads through to a bright, and spacious entrance hall. To the left, lies a large Living room with a fireplace with cast iron inset and gas fire, a set of double doors leads through to a large Dining room. To the right there is an open plan Study. The kitchen is fitted with a new white high gloss fitted kitchen with wall and floor units and there is access to the conservatory, also at this level is a utility room and guest wc. Upstairs there are 4 bedrooms (master ensuite), a large family bathroom and are three large double bedrooms while the fourth is a generous single room. Good size attic ideal for storage. Outside there is a well planted front garden with off-street parking for two cars while to the rear there is a delightful westerly facing lawned garden with new grass turf with herbaceous borders and well screened by mature hedging and trees. Situated in the heart of Booterstown the convenience of the location cannot be overstated. Fosterbrook is between the Stillorgan Road and the Rock Road with local shopping on Woodbine Road and Mount Merrion. The Merrion Shopping Centre, Blackrock, Donnybrook and Stillorgan Villages are within a short drive and access to the M50 and Dundrum Shopping Centre is also just a short drive up Fosters Avenue. Many of Dublin's premier schools are close by including St. Andrew's, Mount Anville, The Teresian School, Blackrock College, St. Michaels and UCD Belfield. Recreational amenities are well supplied with UCD sports grounds, Elm Park Golf Club and Booterstown Bird Sanctuary for leisurely walks. The area is well served by public transport, with an excellent supply of bus routes on the QBC, not to mention the DART station in Booterstown within a short stroll.", "price": "4000 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/2/3/3/3400332/7accb235-7b6d-42fe-89fc-322afdd45200_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/553d12f6-1f16-44e3-92d0-1ff62c9e826a_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/db7b821c-84cc-430b-87e7-8431c1ac722b_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/8c3a72fa-9535-4a52-b09e-4eaf6269d99c_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/e7df43b5-299f-421d-8efa-6cfe9c63cb51_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/c84b168f-bd3b-4da1-a761-c2b693ee4cbd_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/dc2fc6a8-3337-454d-abb6-82edfe2f6987_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/6f26aaec-4a67-4a55-9c85-71052f8b6f5a_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/a28ef8c1-db38-4bdf-ad1e-e3c1fed2f5dd_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/fdf00046-978e-452f-9835-119af4005d07_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/559e2828-31af-4134-aa6e-a3df34673f89_l.jpg", "http://photos-a.propertyimages.ie/media/2/3/3/3400332/b115feca-6d97-4961-b3