{"services_in_this_area": null, "ber_detail": ["BER Rating: BER B2", "BER Number: 108025321", "Energy Performance Indicator: 113.36"], "features": [], "agentFax": "021 4278255", "negotiator": null, "agentName": "Sherry Fitzgerald Lettings - Cork", "property_type": "4 Bed To Let", "leaseTerm": null, "latitude": 51.8010751, "description": "Sherry FitzGerald Lettings are delighted to bring this exceptional home to the rental market. When Crosshaven is mentioned it immediately conjures up images of famed RCYC sailing club and seafaring activities. Set on a bluff in the woods above this lovely village is Water Meadow; a hidden enclave of just five new individual detached houses accessed via a private tree lined avenue. ,On the rental market for the very first time, our home owners have invested loving care, an eye for quality and attention to details when building their dream home just a few years ago. Their vision has resulted in a handsome, warm and stylish family home. ,The living accommodation includes: kitchen / dining room / lounge area, a main reception room, a childrens den, a playroom, utility room, guest WC, spacious master bedroom suite with an abundance of slide-robe storage and en-suite bathroom, three further double bedrooms and the family bathroom. ,There are gardens to the front and rear and the house is not overlooked except for the local farmers horses. There is also a large detached garage, providing ample storage for BBQs and bikes. Upstairs above the garage is a very handy and functional home office space. ,This is a property with a warm homely feel. If you are looking for a furnished home then it is without hesitation that we recommend a viewing of this outstanding family home. ,Call or e-mail us now to arrange a private viewing.,BER: B2 # 108025321,Directions: ,Travel to Crosshaven via Carrigaline. As you enter to village, see Hassetts restaurant on the right hand side. Turn right just before the restaurant. Travel up this private road for 100 metr