{"services_in_this_area": null, "ber_detail": null, "features": [], "agentFax": null, "negotiator": null, "agentName": "Citybreak Apartments", "property_type": "3 Bed Terraced House To Let  1 year lease", "leaseTerm": "1 year Lease", "latitude": 52.9163142, "description": "Month of January,February and March - House available for rent - EUR1,250 per month for minimum 4 week stay. With it's one-mile stretch of golden beach, Lahinch is one of Ireland's most popular resorts offering visitors great variety, with spectacular scenery, varied entertainment, great sport, friendly people and choice accommodation. To the north of county Clare, the rugged Atlantic coast rises nearly 700 feet above the sea in the shape of the Cliffs of Moher. A couple of miles away, you'll find an amazing Karst limestone region called the Burren, which features caves, underground streams and rare alpine flora. The area also has plenty of fascinating archaeological sites, including the 5000-year-old Poulnabrone Dolmen. Charming villages like Doolin, Fanore and Ennistymon are famed for their traditional music sessions. Clare is an ideal destination for those in search of the outdoors; sea, lake and river fishing, walking and cycling and of course golfing are all popular activities in the county. Lahinch is famous for its surfing beaches and creators for all levels. Cliffs of Moher: The Cliffs of Moher are one of Ireland's top Visitor attractions. The Cliffs are 214m high at the highest point and range for 8 kilometres over the Atlantic Ocean on the western seaboard of County Clare. O'Brien's Tower stands proudly on a headland of the majestic Cliffs. From the Cliffs one can see the Aran Islands, Galway Bay, as well as The Twelve Pins, the Maum Turk Mountains in Connemara and Loop Head to the South. The Cliffs of Moher take their name from a ruined promontory fort \"Mothar\" which was demolished during the Napoleonic wars to make room for a signal tower. The Cliffs of Moher are home to one of the major colonies of cliff nesting seabirds in Ireland. The area was designated as a Special Protection Area (SPA) for Birds under the EU Birds Directive in 1986 and as a Refuge for Fauna in 1988. Included within the designated site are the cliffs, the cliff-top maritime grassland and heath, and a 200 metre zone of open water, directly in front of the cliffs. Surfing: The two-mile long beach in Lahinch with its variety of breaks caters for novice, intermediate and experienced surfers. 5 miles further south you will find Spanish Point, another perfect surfing beach. Both are some of the best places in Europe to learn surfing with the advantage of the slower rolling Atlantic waves. John McCarthy, Former Irish Surf Champ and his crew of hardcore surfdude instructors, invites you and your friends to come and experience the thrill and excitement of surfing at Irelands best known SurfSchool.", "price": "1000 / month", "image_urls": ["http://photos-a.propertyimages.ie/media/7/7/7/2987777/342ae0a5-61e3-405f-af92-89c5ea6e5c4e_l.jpg", "http://photos-a.propertyimages.ie/media/7/7/7/2987777/1e2c7706-8ce6-4d3e-832f-f7beb8fb74ae_l.jpg", "http://photos-a.propertyimages.ie/media/7/7/7/2987777/67303fe6-cc19-45d5-8429-7c884d5d958c_l.jpg", "http://photos-a.propertyimages.ie/media/7/7/7/2987777/74a7a263-e5a4-4480-b0b4-3fcd0a8c3d90_l.jpg", "http://photos-a.propertyimages.ie/media/7/7/7/2987777/eb75db9f-2e40-4c76-bb8b-299d12fabe0b_l.jpg", "http://photos-a.propertyimages.ie/media/7/7/7/2987777/1ae6c03b-9de3-46f8-b58a-177601d36e21_l.jpg", "http://photos-a.propertyimages.ie/media/7/7/7/2987777/47682e39-71fb-43f7-8e14-8cb1ea9c5698_l.jpg", "http://photos-a.propertyimages.ie/media/7/7/7/2987777/224a54e7-ceac-42d6-bac7-ff9376eb6423_l.jpg", "http://photos-a.propertyimages.ie/media/7/7/7/2987777/92f44349-456c-4ff6-9cf7-d2700668f74d_l.jpg", "http://photos-a.propertyimages.ie/media/7/7/7/2987777/33910adf-c466-4a4d-b66f-05519f19ccc8_l.jpg", "http://photos-a.propertyimages.ie/media/7/7/7/2987777/69f57b1c